import Weird from "./Weird";
import {useState} from "react";

const RegS=(props)=>{
    const {val,index} = props;
    let year= 1820;
    let myname=" JOSHY";
    const [word,setWord]=useState(0);
    
    const showv=()=>{
      console.log(word);
      setWord(word+1);
    }

    return (
      <div key={index}>
        <h2>Vals:{val}</h2>
        <h2>counter:{word}</h2>
        <button onclick={()=>showv()}>CLICK ME!</button>
      </div>
       
      );
}
export default RegS;
